  expect(label.text()).to.equal('Email address');
});
cy.contains('nb-card', 'Basic form').find('.custom-checkbox').click();

cy.visit("/");
cy.contains('Forms').click();
cy.contains('Datepicker').click();
cy.contains('Common Datepicker').parent('nb-card').find('input').then(input => {
  cy.wrap(input).click();
  cy.get('nb-base-calendar').contains('17').click();
  cy.wrap(input).invoke('prop', 'value').should('contain', '17');
});

cy.visit("/");
cy.contains('Forms').click();
cy.contains('Form Layout').click();
cy.contains('nb-card', 'Using the Grid').get('[type="radio"]').then(radioButtons => {
  cy.wrap(radioButtons).eq(0).check({
    force: true
  });
  cy.wrap(radioButtons).eq(1).should('not.be.checked').check({
    force: true
  }).should('be.checked');
  cy.wrap(radioButtons).eq(0).should('not.be.checked');
  cy.wrap(radioButtons).eq(2).should('be.disabled');
});

cy.visit('/');
cy.get('nav nb-select').click().then(dropdown => {
  cy.wrap(dropdown).get('nav nb-select').then(dropdownDefaultText => {
    cy.wrap(dropdown).get('.options-list .ng-star-inserted').each(options => {
      const dropdownOptions = options.text().trim();
      cy.wrap(options).click();
      cy.wrap(dropdownDefaultText).should('contain', dropdownOptions);
      cy.wrap(dropdown).click();
    });
    cy.wrap(dropdown).click();
  });
});

const age = [20, 30, 40];
cy.wrap(age).each(age => {
  cy.get('thead').find('[placeholder="Age"]').clear().type(age);
  cy.wait(500);
  cy.get('tbody tr').each(tableRow => {
    cy.wrap(tableRow).find('td').eq(6).should('contain', age);
  });
});

cy.visit('/');
cy.contains('Tables & Data').click();
cy.contains('Smart Table').click();
const stub = cy.stub();
cy.on('window:confirm', stub);
cy.get('tbody tr').first().find('.nb-trash').click().then(() => {
  expect(stub.getCall(0)).to.be.calledWith('Are you sure you want to delete?');
});

